import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Moment from "react-moment";
const { detect } = require("detect-browser");

let now = new Date();
const browser = null;

if (process.browser) {
  const browser = detect();

  // alert(browser.name);
}

const SystemInfo = props => (
  <div>
    <Row>
      <Col sm={3} md={3} lg={3} xl={3}></Col>
      <Col sm={3} md={3} lg={3} xl={3}></Col>
      <Col sm={3} md={3} lg={3} xl={3}>
        <p>
          Browser <b>{browser}</b>
        </p>
      </Col>
      <Col sm={3} md={3} lg={3} xl={3}>
        <Moment interval={0}>{now}</Moment>
      </Col>
    </Row>
  </div>
);

export default SystemInfo;
